import react, {Component}from 'react';
import '/registerform.css';

class Registerform extends Component {

    render() {
        return(
            <div>
                <div class="buttons has-addons">
                    <button class="button">Yes</button>
                    <button class="button">Maybe</button>
               
                </div>
            </div>
        )
    }
}
